"""
Let us consider this example (array written in general format):

ls = [0, 1, 3, 6, 10]

Its following parts:

ls = [0, 1, 3, 6, 10]
ls = [1, 3, 6, 10]
ls = [3, 6, 10]
ls = [6, 10]
ls = [10]
ls = []
The corresponding sums are (put together in a list): [20, 20, 19, 16, 10, 0]

The function parts_sums (or its variants in other languages) will take as parameter a list ls
and return a list of the sums of its parts as defined above.

Other Examples:
ls = [1, 2, 3, 4, 5, 6]
parts_sums(ls) -> [21, 20, 18, 15, 11, 6, 0]

ls = [744125, 935, 407, 454, 430, 90, 144, 6710213, 889, 810, 2579358]
parts_sums(ls) -> [10037855, 9293730, 9292795, 9292388, 9291934, 9291504, 9291414, 9291270, 2581057,
                    2580168, 2579358, 0]
"""


def parts_sums(ls):
    tmp_lst = []
    for i in range(len(ls) + 1):
        if not ls[i:]:
            tmp_lst.append(0)
        else:
            tmp_lst.append(sum(ls[i:]))

    return tmp_lst


print(parts_sums([]))
print(parts_sums([0, 1, 3, 6, 10]))
print(parts_sums([1, 2, 3, 4, 5, 6]))
print(parts_sums([744125, 935, 407, 454, 430, 90, 144, 6710213, 889, 810, 2579358]))


# Вариант2 для очень больших списков
def parts_sums2(lst):
    lst.insert(0, 0)
    x = sum(lst)
    return [(x := x - lst[idx]) for idx in range(len(lst))]


# Вариант 3 для очень больших списков - наиболее понятный/
# Сначала в result добавляется сумма всего списка.
# Потом для каждого элемента в списке:
# - каждый раз в result добавляется разница между последним элементом в result (сумма всех элементов
# по очереди с текущим) и текущим элементом в списке.
def parts_sums3(ls):
    result = [sum(ls)]
    for item in ls:
        result.append(result[-1] - item)
    return result

print("Вариант 3 для очень больших списков:")
tmp1 = [744125, 935, 407, 454, 430, 90, 144, 6710213, 889, 810, 2579358]
print(tmp1[-1])
print(parts_sums3([744125, 935, 407, 454, 430, 90, 144, 6710213, 889, 810, 2579358]))

